    return 'рЃерЃћрЃю рЃ«рЃљрЃа рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃў рЃбрЃљрЃарЃЮрЃџрЃЮрЃњрЃў. рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃћрЃџрЃЏрЃљ $userName рЃљрЃЏрЃЮрЃўрЃдрЃЮ рЃЉрЃљрЃарЃљрЃЌрЃў Рђћ $cardName. рЃЌрЃљрЃЋрЃўрЃЊрЃљрЃю рЃљрЃ«рЃљрЃџрЃў рЃ«рЃљрЃќрЃўрЃЊрЃљрЃю рЃЊрЃљрЃгрЃћрЃарЃћ рЃцрЃарЃљрЃќрЃљ: рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃўрЃА рЃърЃљрЃАрЃБрЃ«рЃў: рЃЊрЃљ рЃерЃћрЃЏрЃЊрЃћрЃњ рЃћрЃарЃЌ рЃАрЃўрЃбрЃДрЃЋрЃљрЃЊ рЃърЃљрЃАрЃБрЃ«рЃў \"рЃЊрЃўрЃљрЃ«\" рЃљрЃю \"рЃљрЃарЃљ\". рЃерЃћрЃЏрЃЊрЃћрЃњ рЃЊрЃљрЃљрЃЏрЃљрЃбрЃћ рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃюрЃЏрЃљрЃарЃбрЃћрЃЉрЃљ 120РђЊ150 рЃАрЃўрЃбрЃДрЃЋрЃўрЃЌ: 7РђЊ8 рЃгрЃўрЃюрЃљрЃЊрЃљрЃЊрЃћрЃЉрЃљ рЃўрЃЏрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃарЃљрЃбрЃЮрЃЏ рЃЏрЃўрЃ░рЃДрЃљрЃЋрЃА $cardName-рЃўрЃА рЃћрЃюрЃћрЃарЃњрЃўрЃљрЃЏ рЃљрЃАрЃћрЃЌ рЃърЃљрЃАрЃБрЃ«рЃљрЃЏрЃЊрЃћ рЃЊрЃљ рЃарЃљрЃА рЃюрЃўрЃерЃюрЃљрЃЋрЃА рЃћрЃА рЃърЃўрЃарЃљрЃЊрЃљрЃЊ $userName-рЃўрЃАрЃЌрЃЋрЃўрЃА. рЃљрЃ«рЃАрЃћрЃюрЃћ $userName-рЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃў рЃЏрЃўрЃюрЃўрЃЏрЃБрЃЏ рЃЮрЃарЃ»рЃћрЃа, рЃЕрЃљрЃарЃЌрЃћ 1РђЊ2 рЃЌрЃћрЃЏрЃљрЃбрЃБрЃарЃў рЃћрЃЏрЃЮрЃ»рЃў, рЃЏрЃЮрЃћрЃарЃўрЃЊрЃћ рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃЮрЃћрЃЉрЃА *, # рЃЊрЃљ рЃюрЃћрЃЉрЃўрЃАрЃЏрЃўрЃћрЃа рЃЏрЃљрЃарЃЎрЃљрЃърЃА; рЃгрЃљрЃўрЃгрЃћрЃарЃћ рЃЏрЃљрЃарЃбрЃўрЃЋрЃў, рЃАрЃљрЃБрЃЉрЃарЃўрЃА рЃАрЃбрЃўрЃџрЃўрЃЌ.';
