  @override
  String celtic_cross_screen_prompt(
      Object challengeCard,
      Object consciousCard,
      Object environmentCard,
      Object hiddenCard,
      Object hopesCard,
      Object outcomeCard,
      Object pastCard,
      Object presentCard,
      Object selfCard,
      Object situationCard,
      Object subconsciousCard,
      Object userName,
      Object userQuestion) {
    return 'рЃерЃћрЃю рЃ«рЃљрЃа рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃў рЃбрЃљрЃарЃЮрЃџрЃЮрЃњрЃў. рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃћрЃџрЃў $userName рЃћрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃљ: \"$userQuestion\". рЃБрЃърЃљрЃАрЃБрЃ«рЃћ \"рЃЎрЃћрЃџрЃбрЃБрЃарЃў рЃ»рЃЋрЃарЃўрЃА\" рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃўрЃЌ (рЃБрЃћрЃўрЃбрЃўрЃА рЃЎрЃџрЃљрЃАрЃўрЃЎрЃБрЃарЃў рЃАрЃЦрЃћрЃЏрЃљ). рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў рЃњрЃљрЃЊрЃљрЃфрЃћрЃЏрЃБрЃџрЃўрЃљ рЃљрЃАрЃћ: рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃљ - $situationCard; рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃљ - $challengeCard; рЃБрЃњрЃЮрЃюрЃЮ - $subconsciousCard; рЃБрЃљрЃ«рЃџрЃћрЃАрЃў рЃгрЃљрЃарЃАрЃБрЃџрЃў - $pastCard; рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃў - $consciousCard; рЃБрЃљрЃ«рЃџрЃЮрЃћрЃАрЃў рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў - $hiddenCard; рЃерЃўрЃюрЃљрЃњрЃљрЃюрЃў рЃЏрЃћ - $selfCard; рЃњрЃљрЃарЃћрЃЏрЃЮ - $environmentCard; рЃўрЃЏрЃћрЃЊрЃћрЃЉрЃў рЃљрЃю рЃерЃўрЃерЃћрЃЉрЃў - $hopesCard; рЃерЃћрЃЊрЃћрЃњрЃў - $outcomeCard. рЃљрЃ«рЃАрЃћрЃюрЃћ рЃАрЃљрЃ«рЃћрЃџрЃў $userName рЃЏрЃўрЃюрЃўрЃЏрЃБрЃЏ рЃћрЃЦрЃЋрЃАрЃ»рЃћрЃа рЃЊрЃљ рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃџрЃљрЃЊ рЃЊрЃљрЃБрЃЎрЃљрЃЋрЃерЃўрЃарЃћ рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЉрЃљрЃарЃљрЃЌрЃў рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃА. рЃЊрЃљрЃўрЃфрЃљрЃЋрЃў рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ:\n1) рЃЏрЃўрЃАрЃљрЃџрЃЏрЃћрЃЉрЃљ рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ $userName.\n2) рЃАрЃљрЃЌрЃљрЃБрЃарЃў: рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ: рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃљ ($situationCard) / рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃљ ($challengeCard) / рЃБрЃњрЃЮрЃюрЃЮ ($subconsciousCard) / рЃБрЃљрЃ«рЃџрЃћрЃАрЃў рЃгрЃљрЃарЃАрЃБрЃџрЃў ($pastCard) / рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃў ($consciousCard) / рЃБрЃљрЃ«рЃџрЃЮрЃћрЃАрЃў рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў ($hiddenCard) / рЃерЃўрЃюрЃљрЃњрЃљрЃюрЃў рЃЏрЃћ ($selfCard) / рЃњрЃљрЃарЃћрЃЏрЃЮ ($environmentCard) / рЃўрЃЏрЃћрЃЊрЃћрЃЉрЃў/рЃерЃўрЃерЃћрЃЉрЃў ($hopesCard) / рЃерЃћрЃЊрЃћрЃњрЃў ($outcomeCard).\n3) рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃљ Рђћ $situationCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃАрЃљрЃЏрЃў рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃАрЃўрЃбрЃДрЃЋрЃљ, рЃЉрЃљрЃарЃљрЃЌрЃўрЃА рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃўрЃЎрЃљ рЃЊрЃљ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃЏрЃЊрЃњрЃЮрЃЏрЃљрЃарЃћрЃЮрЃЉрЃљ рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃќрЃћ $userQuestion $userName-рЃАрЃЌрЃЋрЃўрЃА.\n4) рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃљ Рђћ $challengeCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃЏрЃЌрЃљрЃЋрЃљрЃарЃў рЃЊрЃљрЃЉрЃарЃЎрЃЮрЃџрЃћрЃЉрЃљ рЃљрЃю рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃљ $userName-рЃАрЃЌрЃЋрЃўрЃА.\n5) рЃБрЃњрЃЮрЃюрЃЮ Рђћ $subconsciousCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃЊрЃљрЃЏрЃљрЃџрЃБрЃџрЃў рЃЏрЃЮрЃбрЃўрЃЋрЃћрЃЉрЃў рЃљрЃю рЃћрЃюрЃћрЃарЃњрЃўрЃћрЃЉрЃў, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф рЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃћрЃю $userName-рЃќрЃћ.\n6) рЃБрЃљрЃ«рЃџрЃћрЃАрЃў рЃгрЃљрЃарЃАрЃБрЃџрЃў Рђћ $pastCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃЏрЃЮрЃЋрЃџрЃћрЃюрЃћрЃЉрЃў, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃЏрЃљрЃф $userName рЃЏрЃўрЃўрЃДрЃЋрЃљрЃюрЃљ рЃљрЃЏрЃЪрЃљрЃЏрЃўрЃюрЃЊрЃћрЃџ рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃљрЃЏрЃЊрЃћ.\n7) рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃў Рђћ $consciousCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃЏрЃўрЃќрЃюрЃћрЃЉрЃў, рЃЏрЃЮрЃџрЃЮрЃЊрЃўрЃюрЃћрЃЉрЃў рЃљрЃю рЃўрЃА, рЃарЃљрЃАрЃљрЃф $userName рЃљрЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃћрЃЉрЃА.\n8) рЃБрЃљрЃ«рЃџрЃЮрЃћрЃАрЃў рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў Рђћ $hiddenCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃАрЃљрЃЋрЃљрЃарЃљрЃБрЃЊрЃЮ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ рЃБрЃљрЃ«рЃџрЃЮрЃћрЃА рЃЎрЃЋрЃўрЃарЃћрЃЉрЃерЃў.\n9) рЃерЃўрЃюрЃљрЃњрЃљрЃюрЃў рЃЏрЃћ Рђћ $selfCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): $userName-рЃўрЃА рЃЏрЃЊрЃњрЃЮрЃЏрЃљрЃарЃћрЃЮрЃЉрЃљ, рЃарЃћрЃАрЃБрЃарЃАрЃћрЃЉрЃў.\n10) рЃњрЃљрЃарЃћрЃЏрЃЮ Рђћ $environmentCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃњрЃљрЃарЃћрЃЏрЃЮрЃћрЃЉрЃћрЃЉрЃўрЃА рЃњрЃљрЃЋрЃџрЃћрЃюрЃљ.\n11) рЃўрЃЏрЃћрЃЊрЃћрЃЉрЃў / рЃерЃўрЃерЃћрЃЉрЃў Рђћ $hopesCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): $userName-рЃўрЃА рЃЏрЃЮрЃџрЃЮрЃЊрЃўрЃюрЃћрЃЉрЃў рЃљрЃю рЃерЃўрЃерЃћрЃЉрЃў.\n12) рЃерЃћрЃЊрЃћрЃњрЃў Рђћ $outcomeCard (45-55 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃАрЃљрЃЋрЃљрЃарЃљрЃБрЃЊрЃЮ рЃерЃћрЃЊрЃћрЃњрЃў рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃўрЃА рЃарЃЕрЃћрЃЋрЃўрЃА рЃњрЃљрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉрЃўрЃЌ.\n13) рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃљ: рЃЏрЃћрЃњрЃЮрЃЉрЃарЃБрЃџрЃў рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃљ рЃЊрЃљ рЃърЃЮрЃќрЃўрЃбрЃўрЃБрЃарЃў рЃљрЃцрЃўрЃарЃЏрЃљрЃфрЃўрЃљ (30-35 рЃАрЃўрЃбрЃДрЃЋрЃљ) $userName-рЃАрЃЌрЃЋрЃўрЃА.\nрЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃћрЃЉрЃў: рЃАрЃљрЃћрЃарЃЌрЃЮ рЃЏрЃЮрЃфрЃБрЃџрЃЮрЃЉрЃљ 400-500 рЃАрЃўрЃбрЃДрЃЋрЃљ, рЃфрЃЮрЃфрЃ«рЃљрЃџрЃў, рЃАрЃљрЃБрЃЉрЃарЃўрЃА рЃАрЃбрЃўрЃџрЃў, 4-6 рЃћрЃњрЃќрЃЮрЃбрЃћрЃарЃБрЃџрЃў рЃћрЃЏрЃЮрЃ»рЃў; рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЉрЃџрЃЮрЃЎрЃў рЃњрЃљрЃЏрЃЮрЃДрЃЮрЃцрЃўрЃџрЃў рЃўрЃДрЃЮрЃА рЃЮрЃарЃ»рЃћрЃа рЃљрЃ«рЃљрЃџрЃў рЃ«рЃљрЃќрЃўрЃЌ (\n); рЃљрЃа рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃЮ рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃЮрЃћрЃЉрЃў *, # рЃљрЃю рЃАрЃ«рЃЋрЃљ рЃцрЃЮрЃарЃЏрЃљрЃбрЃўрЃарЃћрЃЉрЃљ; рЃЊрЃљрЃгрЃћрЃарЃћ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃБрЃЉрЃарЃљрЃџрЃЮ рЃбрЃћрЃЦрЃАрЃбрЃљрЃЊ.';
  }

