    return 'рЃерЃћрЃю рЃ«рЃљрЃа рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃў рЃбрЃљрЃарЃЮрЃџрЃЮрЃњрЃў. рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃћрЃџрЃў $userName рЃћрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃљ: \"$userQuestion\". рЃБрЃърЃљрЃАрЃБрЃ«рЃћ рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃўрЃЌ \"рЃгрЃљрЃарЃАрЃБрЃџрЃў - рЃљрЃгрЃЏрЃДрЃЮ - рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў\". рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў рЃњрЃљрЃЊрЃљрЃфрЃћрЃЏрЃБрЃџрЃўрЃљ рЃљрЃАрЃћ: рЃгрЃљрЃарЃАрЃБрЃџрЃў - $pastCard; рЃљрЃгрЃЏрЃДрЃЮ - $presentCard; рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў - $hiddenCard. рЃљрЃ«рЃАрЃћрЃюрЃћ рЃАрЃљрЃ«рЃћрЃџрЃў $userName рЃЏрЃўрЃюрЃўрЃЏрЃБрЃЏ рЃЮрЃЌрЃ«рЃ»рЃћрЃа рЃЊрЃљ рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃџрЃљрЃЊ рЃЊрЃљрЃБрЃЎрЃљрЃЋрЃерЃўрЃарЃћ рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃћрЃЉрЃў рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃА. рЃЊрЃљрЃўрЃфрЃљрЃЋрЃў рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ:\n1) рЃЏрЃўрЃАрЃљрЃџрЃЏрЃћрЃЉрЃљ рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ $userName.\n2) рЃАрЃљрЃЌрЃљрЃБрЃарЃў: рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ: рЃгрЃљрЃарЃАрЃБрЃџрЃў ($pastCard) - рЃљрЃгрЃЏрЃДрЃЮ ($presentCard) - рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў ($hiddenCard).\n3) рЃгрЃљрЃарЃАрЃБрЃџрЃўрЃА рЃЉрЃџрЃЮрЃЎрЃў Рђћ $pastCard (40-50 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃАрЃљрЃЏрЃў рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃАрЃўрЃбрЃДрЃЋрЃљ, рЃЉрЃљрЃарЃљрЃЌрЃўрЃА рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃўрЃЎрЃљ рЃЊрЃљ рЃљрЃ«рЃАрЃюрЃљ, рЃарЃЮрЃњрЃЮрЃа рЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃА рЃгрЃљрЃарЃАрЃБрЃџрЃўрЃА рЃцрЃљрЃЦрЃбрЃћрЃЉрЃў рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃќрЃћ $userQuestion $userName-рЃАрЃЌрЃЋрЃўрЃА.\n4) рЃљрЃгрЃЏрЃДрЃЮрЃА рЃЉрЃџрЃЮрЃЎрЃў Рђћ $presentCard (40-50 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃў, рЃЉрЃљрЃарЃљрЃЌрЃўрЃА рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃўрЃЎрЃљ рЃЊрЃљ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃцрЃљрЃЦрЃбрЃЮрЃарЃћрЃЉрЃў, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф рЃњрЃљрЃЋрЃџрЃћрЃюрЃљрЃА рЃљрЃ«рЃЊрЃћрЃюрЃћрЃю рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃќрЃћ $userQuestion.\n5) рЃЏрЃЮрЃЏрЃљрЃЋрЃџрЃўрЃА рЃЉрЃџрЃЮрЃЎрЃў Рђћ $hiddenCard (40-50 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃў, рЃЉрЃљрЃарЃљрЃЌрЃўрЃА рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃўрЃЎрЃљ рЃЊрЃљ рЃАрЃљрЃЋрЃљрЃарЃљрЃБрЃЊрЃЮ рЃАрЃфрЃћрЃюрЃљрЃарЃў рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃќрЃћ $userName.\n6) рЃерЃћрЃЊрЃћрЃњрЃў: рЃЏрЃЮрЃЎрЃџрЃћ рЃарЃЕрЃћрЃЋрЃљ, рЃърЃЮрЃќрЃўрЃбрЃўрЃБрЃарЃў рЃљрЃцрЃўрЃарЃЏрЃљрЃфрЃўрЃљ (20-30 рЃАрЃўрЃбрЃДрЃЋрЃљ) рЃЊрЃљ рЃерЃљрЃюрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЎрЃљрЃцрЃўрЃЮ рЃерЃћрЃ»рЃљрЃЏрЃћрЃЉрЃљ.\nрЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃћрЃЉрЃў: рЃАрЃљрЃћрЃарЃЌрЃЮ рЃЏрЃЮрЃфрЃБрЃџрЃЮрЃЉрЃљ 180-220 рЃАрЃўрЃбрЃДрЃЋрЃљ, рЃЌрЃЉрЃўрЃџрЃў рЃћрЃњрЃќрЃЮрЃбрЃћрЃарЃБрЃџрЃў рЃбрЃЮрЃюрЃў, 3-5 рЃЌрЃћрЃЏрЃљрЃбрЃБрЃарЃў рЃћрЃЏрЃЮрЃ»рЃў; рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЉрЃџрЃЮрЃЎрЃў рЃњрЃљрЃЏрЃЮрЃДрЃЮрЃцрЃўрЃџрЃў рЃўрЃДрЃЮрЃА рЃЮрЃарЃ»рЃћрЃа рЃљрЃ«рЃљрЃџрЃў рЃ«рЃљрЃќрЃўрЃЌ (\n); рЃљрЃЎрЃарЃФрЃљрЃџрЃБрЃџрЃўрЃљ рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃЮрЃћрЃЉрЃўрЃА *, # рЃљрЃю рЃАрЃ«рЃЋрЃљ рЃцрЃЮрЃарЃЏрЃљрЃбрЃўрЃарЃћрЃЉрЃљ; рЃЊрЃљрЃгрЃћрЃарЃћ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃБрЃЉрЃарЃљрЃџрЃЮ рЃбрЃћрЃЦрЃАрЃбрЃљрЃЊ.';
  }

