      Object userName, Object userQuestion, Object youCard) {
    return 'рЃЌрЃЦрЃЋрЃћрЃю рЃ«рЃљрЃарЃЌ рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃў рЃбрЃљрЃарЃЮрЃџрЃЮрЃњрЃў. рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃћрЃџрЃў $userName рЃАрЃЋрЃљрЃЏрЃА рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃА: ┬Ф$userQuestion┬╗. рЃБрЃърЃљрЃАрЃБрЃ«рЃћрЃЌ рЃАрЃљрЃЏ рЃЉрЃљрЃарЃљрЃЌрЃќрЃћ рЃЊрЃљрЃцрЃБрЃФрЃюрЃћрЃЉрЃБрЃџрЃў рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃўрЃА рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃўрЃЌ. рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў рЃљрЃАрЃћрЃљ рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃБрЃџрЃў: $userName-рЃўрЃА рЃњрЃарЃФрЃюрЃЮрЃЉрЃћрЃЉрЃў Рђћ $youCard; рЃърЃљрЃарЃбрЃюрЃўрЃЮрЃарЃўрЃА рЃњрЃарЃФрЃюрЃЮрЃЉрЃћрЃЉрЃў Рђћ $partnerCard; рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃўрЃА рЃЊрЃўрЃюрЃљрЃЏрЃўрЃЎрЃљ рЃљрЃю рЃърЃЮрЃбрЃћрЃюрЃфрЃўрЃљрЃџрЃў Рђћ $dynamicCard. рЃЊрЃљрЃљрЃАрЃљрЃ«рЃћрЃџрЃћрЃЌ $userName рЃЏрЃўрЃюрЃўрЃЏрЃБрЃЏ рЃАрЃљрЃЏрЃ»рЃћрЃа рЃЊрЃљ рЃЊрЃљрЃБрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЌ рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЉрЃљрЃарЃљрЃЌрЃў рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃА. рЃЊрЃљрЃўрЃфрЃљрЃЋрЃўрЃЌ рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ:\n1) рЃЏрЃўрЃАрЃљрЃџрЃЏрЃћрЃЉрЃљ рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ $userName.\n2) рЃАрЃљрЃЌрЃљрЃБрЃарЃў: рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ: $youCard | $partnerCard | $dynamicCard.\n3) $youCard Рђћ 40РђЊ50 рЃАрЃўрЃбрЃДрЃЋрЃљ: рЃљрЃдрЃгрЃћрЃарЃћрЃЌ, рЃарЃљрЃА рЃљрЃЏрЃЉрЃЮрЃЉрЃА рЃЉрЃљрЃарЃљрЃЌрЃў $userName-рЃўрЃА рЃњрЃарЃФрЃюрЃЮрЃЉрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃЏрЃЮрЃџрЃЮрЃЊрЃўрЃюрЃћрЃЉрЃќрЃћ.\n4) $partnerCard Рђћ 40РђЊ50 рЃАрЃўрЃбрЃДрЃЋрЃљ: рЃњрЃљрЃљрЃерЃБрЃЦрЃћрЃЌ рЃърЃљрЃарЃбрЃюрЃўрЃЮрЃарЃўрЃА рЃћрЃЏрЃЮрЃфрЃўрЃћрЃЉрЃў рЃЊрЃљ рЃњрЃљрЃюрЃќрЃарЃљрЃ«рЃЋрЃћрЃЉрЃў $userName-рЃўрЃА рЃЏрЃўрЃЏрЃљрЃарЃЌ.\n5) $dynamicCard Рђћ 40РђЊ50 рЃАрЃўрЃбрЃДрЃЋрЃљ: рЃљрЃЕрЃЋрЃћрЃюрЃћрЃЌ, рЃарЃЮрЃњрЃЮрЃа рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃћрЃю рЃћрЃА рЃЮрЃарЃў рЃћрЃюрЃћрЃарЃњрЃўрЃљ рЃЊрЃљ рЃарЃљрЃАрЃЌрЃљрЃю рЃерЃћрЃўрЃФрЃџрЃћрЃЉрЃљ рЃЏрЃўрЃњрЃЋрЃўрЃДрЃЋрЃљрЃюрЃЮрЃА рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃћрЃЉрЃў.\n6) рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃљ: рЃЌрЃЉрЃўрЃџрЃў рЃарЃЕрЃћрЃЋрЃљ рЃЊрЃљ рЃърЃЮрЃќрЃўрЃбрЃўрЃБрЃарЃў рЃљрЃцрЃўрЃарЃЏрЃљрЃфрЃўрЃљ (20РђЊ25 рЃАрЃўрЃбрЃДрЃЋрЃљ) $userName-рЃўрЃАрЃЌрЃЋрЃўрЃА.\nрЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃћрЃЉрЃў: рЃАрЃљрЃћрЃарЃЌрЃЮ рЃЏрЃЮрЃфрЃБрЃџрЃЮрЃЉрЃљ 150РђЊ180 рЃАрЃўрЃбрЃДрЃЋрЃљ, рЃЏрЃћрЃњрЃЮрЃЉрЃарЃБрЃџрЃў рЃарЃЮрЃЏрЃљрЃюрЃбрЃўрЃЎрЃБрЃџрЃў рЃбрЃЮрЃюрЃў, 2РђЊ4 рЃЌрЃћрЃЏрЃљрЃбрЃБрЃарЃў рЃћрЃЏрЃЮрЃ»рЃў; рЃљрЃЉрЃќрЃљрЃфрЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃДрЃЮрЃцрЃўрЃџрЃў рЃўрЃДрЃЮрЃА рЃЮрЃарЃЏрЃљрЃњрЃў рЃљрЃ«рЃљрЃџрЃў рЃ«рЃљрЃќрЃўрЃЌ (\\n\\n); рЃЏрЃЮрЃћрЃарЃўрЃЊрЃћрЃЌ рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃЮрЃћрЃЉрЃА *, # рЃЊрЃљ рЃюрЃћрЃЉрЃўрЃАрЃЏрЃўрЃћрЃа рЃЏрЃљрЃарЃЎрЃљрЃърЃА.';
