  @override
  String get celtic_cross_screen_celtic_cross_explanation_dialog =>
      '┬ФрЃЎрЃћрЃџрЃбрЃБрЃарЃў рЃ»рЃЋрЃљрЃарЃў┬╗ рЃљрЃарЃўрЃА 10-рЃЉрЃљрЃарЃљрЃЌрЃўрЃљрЃюрЃў рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЊрЃћрЃбрЃљрЃџрЃБрЃарЃљрЃЊ рЃўрЃЎрЃЋрЃџрЃћрЃЋрЃА рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃљрЃА рЃДрЃЋрЃћрЃџрЃљ рЃЏрЃ«рЃарЃўрЃЊрЃљрЃю: рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃњрЃљрЃарЃћрЃЏрЃЮрЃћрЃЉрЃћрЃЉрЃў, рЃЊрЃљрЃЉрЃарЃЎрЃЮрЃџрЃћрЃЉрЃћрЃЉрЃў, рЃерЃўрЃЊрЃљ рЃЊрЃљ рЃњрЃљрЃарЃћ рЃњрЃљрЃЋрЃџрЃћрЃюрЃћрЃЉрЃў, рЃљрЃАрЃћрЃЋрЃћ рЃБрЃљрЃ«рЃџрЃЮрЃћрЃАрЃў рЃЊрЃўрЃюрЃљрЃЏрЃўрЃЎрЃљ рЃЊрЃљ рЃАрЃљрЃЉрЃЮрЃџрЃЮрЃЮ рЃерЃћрЃЊрЃћрЃњрЃў. рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў рЃўрЃџрЃљрЃњрЃћрЃЉрЃљ рЃерЃћрЃЏрЃЊрЃћрЃњрЃў рЃЌрЃљрЃюрЃЏрЃўрЃЏрЃЊрЃћрЃЋрЃарЃЮрЃЉрЃўрЃЌ:\n1 - рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃљ Рђћ рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃўрЃА рЃљрЃарЃАрЃў рЃљрЃЦ рЃЊрЃљ рЃљрЃ«рЃџрЃљ.\n2 - рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃљ Рђћ рЃўрЃА, рЃарЃљрЃф рЃћрЃ«рЃЏрЃљрЃарЃћрЃЉрЃљ рЃљрЃю рЃБрЃерЃџрЃўрЃА рЃгрЃўрЃюрЃАрЃЋрЃџрЃљрЃА.\n3 - рЃБрЃњрЃЮрЃюрЃЮ (рЃАрЃљрЃЉрЃљрЃЉрЃў) Рђћ рЃЊрЃљрЃЏрЃљрЃџрЃБрЃџрЃў рЃЏрЃЮрЃбрЃўрЃЋрЃћрЃЉрЃў рЃЊрЃљ рЃдрЃарЃЏрЃљ рЃФрЃљрЃџрЃћрЃЉрЃў.\n4 - рЃБрЃљрЃ«рЃџрЃћрЃАрЃў рЃгрЃљрЃарЃАрЃБрЃџрЃў Рђћ рЃЏрЃЮрЃЋрЃџрЃћрЃюрЃћрЃЉрЃў, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф рЃЏрЃўрЃўрЃДрЃЋрЃљрЃюрЃљ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃЏрЃЊрЃњрЃЮрЃЏрЃљрЃарЃћрЃЮрЃЉрЃљрЃЏрЃЊрЃћ.\n5 - рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃў (рЃЏрЃўрЃќрЃљрЃюрЃў) Рђћ рЃўрЃА, рЃарЃљрЃќрЃћрЃф рЃљрЃ«рЃџрЃљ рЃЎрЃЮрЃюрЃфрЃћрЃюрЃбрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃўрЃљ рЃДрЃБрЃарЃљрЃЊрЃдрЃћрЃЉрЃљ рЃЎрЃЋрЃћрЃарЃћрЃюрЃбрЃўрЃА.\n6 - рЃБрЃљрЃ«рЃџрЃЮрЃћрЃАрЃў рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў Рђћ рЃАрЃљрЃЋрЃљрЃарЃљрЃБрЃЊрЃЮ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ рЃБрЃљрЃ«рЃџрЃЮрЃћрЃА рЃЎрЃЋрЃўрЃарЃћрЃЉрЃерЃў.\n7 - ┬ФрЃЏрЃћ рЃЌрЃЋрЃўрЃЌрЃЮрЃю┬╗ Рђћ рЃерЃўрЃюрЃљрЃњрЃљрЃюрЃў рЃЏрЃЊрЃњрЃЮрЃЏрЃљрЃарЃћрЃЮрЃЉрЃљ, рЃарЃћрЃАрЃБрЃарЃАрЃћрЃЉрЃў, рЃЊрЃљрЃЏрЃЮрЃЎрЃўрЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљ рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃўрЃА рЃЏрЃўрЃЏрЃљрЃарЃЌ.\n8 - рЃњрЃљрЃарЃћрЃЏрЃЮ Рђћ рЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃњрЃљрЃарЃћрЃЏрЃЮрЃћрЃЉрЃћрЃЉрЃўрЃА рЃњрЃљрЃЋрЃџрЃћрЃюрЃљ.\n9 - рЃўрЃЏрЃћрЃЊрЃћрЃЉрЃў / рЃерЃўрЃерЃћрЃЉрЃў Рђћ рЃЏрЃЮрЃџрЃЮрЃЊрЃўрЃюрЃћрЃЉрЃў, рЃћрЃГрЃЋрЃћрЃЉрЃў, рЃФрЃџрЃўрЃћрЃарЃў рЃћрЃЏрЃЮрЃфрЃўрЃћрЃЉрЃў.\n10 - рЃерЃћрЃЊрЃћрЃњрЃў Рђћ рЃерЃћрЃАрЃљрЃФрЃџрЃЮ рЃњрЃљрЃЏрЃЮрЃАрЃљрЃЋрЃљрЃџрЃў, рЃЌрЃБ рЃбрЃћрЃюрЃЊрЃћрЃюрЃфрЃўрЃћрЃЉрЃў рЃерЃћрЃюрЃљрЃарЃЕрЃБрЃюрЃЊрЃћрЃЉрЃљ.\nрЃћрЃА рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ рЃАрЃљрЃерЃБрЃљрЃџрЃћрЃЉрЃљрЃА рЃўрЃФрЃџрЃћрЃЋрЃљ рЃЊрЃљрЃўрЃюрЃљрЃ«рЃЮрЃЌ ┬ФрЃЊрЃўрЃЊрЃў рЃАрЃБрЃарЃљрЃЌрЃў┬╗: рЃАрЃљрЃЊ рЃЊрЃњрЃљрЃ«рЃљрЃарЃЌ, рЃарЃљ рЃњрЃўрЃерЃџрЃўрЃЌ рЃљрЃю рЃњрЃћрЃ«рЃЏрЃљрЃарЃћрЃЉрЃљрЃЌ, рЃарЃЮрЃЏрЃћрЃџрЃў рЃЊрЃљрЃЏрЃљрЃџрЃБрЃџрЃў рЃўрЃЏрЃърЃБрЃџрЃАрЃћрЃЉрЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃћрЃю рЃЎрЃБрЃџрЃўрЃАрЃћрЃЉрЃА рЃЏрЃўрЃдрЃЏрЃљ рЃЊрЃљ рЃАрЃљрЃЊ рЃЏрЃўрЃЊрЃўрЃА рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃў рЃерЃћрЃЏрЃЊрЃћрЃњ.\nрЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃўрЃА рЃАрЃЦрЃћрЃЏрЃљ рЃгрЃљрЃарЃЏрЃЮрЃЊрЃњрЃћрЃюрЃўрЃџрЃўрЃљ рЃЦрЃЋрЃћрЃЏрЃЮрЃЌ рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџ рЃАрЃБрЃарЃљрЃЌрЃќрЃћ.';

