    return 'рЃерЃћрЃю рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃЮрЃюрЃљрЃџрЃў рЃбрЃљрЃарЃЮрЃџрЃЮрЃњрЃў рЃ«рЃљрЃа. рЃЊрЃљрЃгрЃћрЃарЃћ рЃерЃЌрЃљрЃЏрЃљрЃњрЃЮрЃюрЃћрЃЉрЃћрЃџрЃў рЃерЃћрЃбрЃДрЃЮрЃЉрЃўрЃюрЃћрЃЉрЃљ \"рЃЊрЃдрЃўрЃА рЃЉрЃљрЃарЃљрЃЌрЃў\" рЃљрЃЏ рЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃўрЃА рЃћрЃюрЃљрЃќрЃћ рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА $name. рЃЊрЃљрЃўрЃфрЃљрЃЋрЃў рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃЊрЃљ рЃЏрЃЮрЃфрЃБрЃџрЃЮрЃЉрЃљ.\n­ЪїЪ $name, рЃерЃћрЃюрЃў рЃЊрЃдрЃўрЃА рЃЉрЃљрЃарЃљрЃЌрЃўрЃљ Рђћ $cardName!\n­ЪћЉ рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃў: <рЃЕрЃљрЃгрЃћрЃарЃћ 3РђЊ5 рЃЏрЃЮрЃЎрЃџрЃћ рЃАрЃљрЃЎрЃЋрЃљрЃюрЃФрЃЮ рЃАрЃўрЃбрЃДрЃЋрЃљ>\n­ЪЃЈ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљ (рЃЊрЃљрЃљрЃ«рЃџрЃЮрЃћрЃЉрЃўрЃЌ 45РђЊ50 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃљрЃдрЃгрЃћрЃарЃћ рЃЉрЃљрЃарЃљрЃЌрЃўрЃА рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃћрЃюрЃћрЃарЃњрЃўрЃљ рЃЊрЃљ рЃарЃЮрЃњрЃЮрЃа рЃњрЃљрЃЏрЃЮрЃЕрЃюрЃЊрЃћрЃЉрЃљ рЃўрЃА рЃЊрЃдрЃћрЃА $name-рЃАрЃЌрЃЋрЃўрЃА.\n­ЪњА рЃарЃЕрЃћрЃЋрЃљ (рЃЊрЃљрЃљрЃ«рЃџрЃЮрЃћрЃЉрЃўрЃЌ 35РђЊ40 рЃАрЃўрЃбрЃДрЃЋрЃљ): рЃерЃћрЃАрЃЌрЃљрЃЋрЃљрЃќрЃћ рЃЎрЃЮрЃюрЃЎрЃарЃћрЃбрЃБрЃџрЃў рЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљ рЃљрЃю рЃњрЃљрЃюрЃгрЃДрЃЮрЃЉрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЊрЃљрЃћрЃ«рЃЏрЃљрЃарЃћрЃЉрЃљ $name-рЃА рЃљрЃЏ рЃћрЃюрЃћрЃарЃњрЃўрЃўрЃА рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃљрЃерЃў.\nРюе рЃљрЃцрЃўрЃарЃЏрЃљрЃфрЃўрЃљ (1 рЃАрЃбрЃарЃўрЃЦрЃЮрЃюрЃў): рЃърЃЮрЃќрЃўрЃбрЃўрЃБрЃарЃў рЃњрЃљрЃюрЃфрЃ«рЃљрЃЊрЃћрЃЉрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃўрЃгрЃДрЃћрЃЉрЃљ рЃАрЃўрЃбрЃДрЃЋрЃўрЃЌ РђърЃЏрЃћРђд\".';
  }

