    return 'рЃерЃћрЃю рЃ«рЃљрЃа рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃЮрЃюрЃљрЃџрЃў рЃбрЃљрЃарЃЮрЃџрЃЮрЃњрЃў. рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃћрЃџрЃў $userName рЃћрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃљ: \"$userQuestion\". рЃерЃћрЃљрЃЊрЃњрЃўрЃюрЃћ рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ \"рЃЌрЃЋрЃўрЃБрЃарЃў рЃЉрЃЮрЃарЃЉрЃљрЃџрЃў\" $month-рЃќрЃћ. рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў рЃЏрЃўрЃЊрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњрЃў рЃарЃўрЃњрЃўрЃЌ: 1 Рђћ $card1, 2 Рђћ $card2, 3 Рђћ $card3, 4 Рђћ $card4, 5 Рђћ $card5, 6 Рђћ $card6, 7 Рђћ $card7, 8 Рђћ $card8, 9 Рђћ $card9, 10 Рђћ $card10, 11 Рђћ $card11, 12 Рђћ $card12. рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃћ $userName-рЃўрЃА рЃАрЃЦрЃћрЃАрЃў рЃАрЃљрЃ«рЃћрЃџрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ рЃЊрЃљ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћ рЃАрЃгрЃЮрЃарЃў рЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃћрЃЉрЃў рЃЊрЃљ рЃќрЃЏрЃюрЃћрЃЉрЃў. рЃљрЃ«рЃАрЃћрЃюрЃћ рЃАрЃљрЃ«рЃћрЃџрЃў рЃЏрЃўрЃюрЃўрЃЏрЃБрЃЏ рЃ«рЃБрЃЌрЃ»рЃћрЃа, рЃЏрЃљрЃњрЃарЃљрЃЏ **рЃљрЃа рЃЕрЃљрЃАрЃЋрЃљ рЃДрЃЮрЃЋрЃћрЃџ рЃЌрЃљрЃарЃўрЃдрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ** Рђћ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃарЃЕрЃћрЃЋрЃћрЃЉрЃўрЃА рЃбрЃћрЃЦрЃАрЃбрЃерЃў. рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћ рЃЎрЃљрЃџрЃћрЃюрЃЊрЃљрЃарЃБрЃџрЃў рЃЌрЃљрЃарЃўрЃдрЃћрЃЉрЃўрЃА рЃЦрЃАрЃћрЃџрЃў: 1РђЊ3, 4РђЊ6, 7РђЊ9, 10РђЊ12, 13РђЊ15, 16РђЊ18, 19РђЊ21, 22РђЊ24, 25РђЊ26, 27РђЊ28, 29РђЊ30, 31 (рЃЌрЃБ рЃЌрЃЋрЃћрЃерЃў 30 рЃЊрЃдрЃћрЃљ, 12-рЃћ рЃЉрЃљрЃарЃљрЃЌрЃў рЃљрЃАрЃћрЃЋрЃћ рЃћрЃ«рЃћрЃЉрЃљ 30-рЃА). рЃцрЃЮрЃарЃЏрЃљрЃбрЃў:\n1) рЃЏрЃўрЃАрЃљрЃџрЃЏрЃћрЃЉрЃљ $userName-рЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ (1РђЊ2 рЃгрЃўрЃюрЃљрЃЊрЃљрЃЊрЃћрЃЉрЃљ).\n2) рЃЏрЃЮрЃЎрЃџрЃћ рЃерЃћрЃАрЃљрЃЋрЃљрЃџрЃў рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃўрЃА рЃЏрЃўрЃќрЃюрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ (1 рЃгрЃўрЃюрЃљрЃЊрЃљрЃЊрЃћрЃЉрЃљ).\n3РђЊ14) рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЉрЃљрЃарЃљрЃЌрЃўрЃАрЃЌрЃЋрЃўрЃА рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћ рЃАрЃбрЃарЃўрЃЦрЃЮрЃюрЃў \"1РђЊ3 $month Рђћ $card1\" (рЃАрЃљрЃ«рЃћрЃџрЃўрЃА рЃњрЃљрЃарЃћрЃерЃћ): рЃерЃћрЃЏрЃЊрЃћрЃњ 2РђЊ3 рЃгрЃўрЃюрЃљрЃЊрЃљрЃЊрЃћрЃЉрЃљ рЃърЃћрЃарЃўрЃЮрЃЊрЃўрЃА рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃћрЃюрЃћрЃарЃњрЃўрЃўрЃАрЃљ рЃЊрЃљ рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃБрЃџрЃў рЃарЃЕрЃћрЃЋрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃЮрЃарЃњрЃљрЃюрЃБрЃџрЃљрЃЊ рЃљрЃ«рЃАрЃћрЃюрЃћ $userName.\n15) рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃљ: рЃАрЃљрЃћрЃарЃЌрЃЮ рЃарЃЕрЃћрЃЋрЃљ рЃЌрЃЋрЃћрЃќрЃћ (рЃЊрЃљрЃљрЃ«рЃџрЃЮрЃћрЃЉрЃўрЃЌ 40 рЃАрЃўрЃбрЃДрЃЋрЃљ) рЃЊрЃљ рЃЏрЃЮрЃбрЃўрЃЋрЃљрЃфрЃўрЃБрЃарЃў рЃљрЃцрЃўрЃарЃЏрЃљрЃфрЃўрЃљ 2РђЊ3 рЃћрЃЏрЃЮрЃ»рЃўрЃЌ.\nрЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃћрЃЉрЃў: рЃАрЃљрЃћрЃарЃЌрЃЮ 360РђЊ400 рЃАрЃўрЃбрЃДрЃЋрЃљ; рЃЏрЃћрЃњрЃЮрЃЉрЃарЃБрЃџрЃў, рЃЏрЃЮрЃбрЃўрЃЋрЃљрЃфрЃўрЃБрЃарЃў рЃбрЃЮрЃюрЃў; рЃЉрЃџрЃЮрЃЎрЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃДрЃЮрЃцрЃўрЃџрЃў рЃЮрЃарЃЏрЃљрЃњрЃў \\n\\n-рЃўрЃЌ; рЃљрЃа рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃЮ *, #, рЃАрЃўрЃљ рЃљрЃю рЃбрЃћрЃЦрЃюрЃўрЃЎрЃБрЃарЃў рЃюрЃўрЃерЃюрЃћрЃЉрЃў.';
  }

