    return 'рЃерЃћрЃю рЃ«рЃљрЃа рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџ рЃбрЃљрЃарЃЮрЃџрЃЮрЃњ-рЃЎрЃЮрЃБрЃЕрЃў. рЃЏрЃЮрЃЏрЃ«рЃЏрЃљрЃарЃћрЃЉрЃћрЃџрЃў $userName рЃћрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃљ: ┬Ф$userQuestion┬╗. рЃњрЃљрЃљрЃЎрЃћрЃЌрЃћ рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ РђърЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџрЃў рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ рЃЊрЃљ рЃЉрЃљрЃџрЃљрЃюрЃАрЃў\" рЃерЃЋрЃўрЃЊрЃў рЃЉрЃљрЃарЃљрЃЌрЃўрЃЌ. рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў рЃњрЃљрЃЊрЃљрЃфрЃћрЃЏрЃБрЃџрЃўрЃљ рЃљрЃАрЃћ: рЃЉрЃўрЃарЃЌрЃЋрЃў Рђћ $coreCard; рЃњрЃЮрЃюрЃћрЃЉрЃљ Рђћ $mindCard; рЃћрЃЏрЃЮрЃфрЃўрЃћрЃЉрЃў Рђћ $emotionCard; рЃАрЃ«рЃћрЃБрЃџрЃў Рђћ $bodyCard; рЃарЃћрЃАрЃБрЃарЃАрЃў Рђћ $strengthCard; рЃЊрЃљрЃЉрЃарЃЎрЃЮрЃџрЃћрЃЉрЃљ Рђћ $challengeCard; рЃарЃЕрЃћрЃЋрЃљ Рђћ $adviceCard. рЃњрЃљрЃюрЃАрЃљрЃќрЃдрЃЋрЃарЃћ $userName-рЃўрЃА рЃАрЃЦрЃћрЃАрЃў рЃАрЃљрЃ«рЃћрЃџрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ рЃЊрЃљ рЃЏрЃўрЃЏрЃљрЃарЃЌрЃћ рЃАрЃгрЃЮрЃа рЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ рЃќрЃЏрЃюрЃћрЃЉрЃўрЃЌ. рЃўрЃАрЃљрЃБрЃЉрЃарЃћ рЃфрЃЮрЃфрЃ«рЃџрЃљрЃЊ рЃЊрЃљ рЃЏрЃ«рЃюрЃћрЃЊ, рЃљрЃ«рЃАрЃћрЃюрЃћ $userName-рЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃў рЃЏрЃўрЃюрЃўрЃЏрЃБрЃЏ рЃЮрЃЌрЃ«рЃ»рЃћрЃа рЃЊрЃљ рЃљрЃБрЃфрЃўрЃџрЃћрЃЉрЃџрЃљрЃЊ рЃЊрЃљрЃБрЃЎрЃљрЃЋрЃерЃўрЃарЃћ рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЉрЃљрЃарЃљрЃЌрЃў рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃА. рЃЊрЃљрЃўрЃфрЃљрЃЋрЃў рЃАрЃбрЃарЃБрЃЦрЃбрЃБрЃарЃљ рЃЊрЃљ рЃцрЃЮрЃарЃЏрЃљрЃбрЃў:\n1) рЃЏрЃўрЃАрЃљрЃџрЃЏрЃћрЃЉрЃљ $userName-рЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ.\n2) рЃАрЃљрЃЌрЃљрЃБрЃарЃў: рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃљ: $coreCard | $mindCard | $emotionCard | $bodyCard | $strengthCard | $challengeCard | $adviceCard.\n3) $coreCard Рђћ рЃљрЃдрЃгрЃћрЃарЃћ $userName-рЃўрЃА рЃЌрЃЋрЃўрЃЌрЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃЏрЃЌрЃљрЃЋрЃљрЃарЃў рЃцрЃЮрЃЎрЃБрЃАрЃў.\n4) $mindCard Рђћ рЃБрЃЌрЃ«рЃљрЃарЃў, рЃарЃЮрЃњрЃЮрЃа рЃЊрЃљрЃљрЃарЃћрЃњрЃБрЃџрЃўрЃарЃЮрЃА рЃљрЃќрЃарЃЮрЃЋрЃюрЃћрЃЉрЃљ рЃЊрЃљ рЃарЃљрЃА рЃўрЃАрЃгрЃљрЃЋрЃџрЃЮрЃА.\n5) $emotionCard Рђћ рЃњрЃљрЃљрЃерЃБрЃЦрЃћ рЃћрЃЏрЃЮрЃфрЃўрЃБрЃарЃў рЃарЃћрЃАрЃБрЃарЃАрЃў рЃЊрЃљ рЃЏрЃЮрЃбрЃўрЃЋрЃљрЃфрЃўрЃљ.\n6) $bodyCard Рђћ рЃБрЃарЃЕрЃўрЃћ, рЃарЃЮрЃњрЃЮрЃа рЃўрЃќрЃарЃБрЃюрЃЮрЃА рЃАрЃ«рЃћрЃБрЃџрЃАрЃљ рЃЊрЃљ рЃћрЃюрЃћрЃарЃњрЃўрЃљрЃќрЃћ.\n7) $strengthCard Рђћ рЃљрЃЕрЃЋрЃћрЃюрЃћ рЃерЃўрЃюрЃљрЃњрЃљрЃюрЃў рЃАрЃљрЃЕрЃБрЃЦрЃљрЃарЃў рЃљрЃю рЃњрЃљрЃарЃћ рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃљ.\n8) $challengeCard Рђћ рЃЏрЃўрЃБрЃЌрЃўрЃЌрЃћ рЃЏрЃЌрЃљрЃЋрЃљрЃарЃў рЃЊрЃўрЃАрЃЉрЃљрЃџрЃљрЃюрЃАрЃў рЃЊрЃљ рЃЏрЃўрЃАрЃў рЃЏрЃўрЃќрЃћрЃќрЃћрЃЉрЃў.\n9) $adviceCard Рђћ рЃерЃћрЃАрЃЌрЃљрЃЋрЃљрЃќрЃћ рЃЎрЃЮрЃюрЃЎрЃарЃћрЃбрЃБрЃџрЃў рЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃљрЃћрЃарЃЌрЃўрЃљрЃюрЃћрЃЉрЃА рЃДрЃЋрЃћрЃџрЃљ рЃљрЃАрЃърЃћрЃЦрЃбрЃА.\n10) рЃЊрЃљрЃАрЃљрЃАрЃарЃБрЃџрЃў: рЃЏрЃЮрЃбрЃўрЃЋрЃљрЃфрЃўрЃБрЃарЃў рЃљрЃцрЃўрЃарЃЏрЃљрЃфрЃўрЃљ рЃЊрЃљ рЃЌрЃЉрЃўрЃџрЃў рЃАрЃБрЃарЃЋрЃўрЃџрЃћрЃЉрЃў 2РђЊ3 рЃћрЃЏрЃЮрЃ»рЃўрЃЌ.\nрЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃћрЃЉрЃў: рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃърЃБрЃюрЃЦрЃбрЃў 2РђЊ3 рЃгрЃўрЃюрЃљрЃЊрЃљрЃЊрЃћрЃЉрЃљ; рЃърЃБрЃюрЃЦрЃбрЃћрЃЉрЃА рЃерЃЮрЃарЃўрЃА рЃЮрЃарЃЏрЃљрЃњрЃў \\n\\n; рЃљрЃа рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃЮ *, # рЃљрЃю рЃАрЃ«рЃЋрЃљ рЃюрЃўрЃерЃюрЃћрЃЉрЃў.';
  }

